import React from "react";

class Radio extends React.Component {
  constructor(props) {
    super(props);

  }
  render() {
    return (
      // HTML code
      <>
        <h4> {this.props.name} </h4>
        <input type="radio" name={this.props.name} value="Every Day" />
        <label> Every Day </label>
        <br />
        <input type="radio" name={this.props.name} value="Every Week" defaultChecked/>
        <label> Every {this.props.day} </label>
      </>
    );
  }
}

export default Radio;
